import React from "react";

class StreamTextClass extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            value: ''
        };
    }

    render() {
        return (
            <div>
                <input
                    placeholder="Class component"
                    type="text"
                    onChange={e => this.setState({ value: e.target.value })} />
                <h1>{this.state.value}</h1>
            </div>
        );
    }
}

export default StreamTextClass;
